sources.components/Services.js:
import React, {Component} from 'react';

class Services extends Component{
  render(){
    return(
      <div>
        <div className='Headings'>
        <hr />
        <h2> Services </h2>
        <hr />
        </div>
        <h4> Consulting </h4>
        <p> Integration of your company's vision with the best practices in design and digital marketing.</p>
        <h4> Branding</h4>
        <p> Development of <b>Logos, Icons, Titles & other branding assets.</b> </p>
        <h4> Webpages </h4>
        <p> Complete front-end codebase of <b>React</b> components for back-end web service providers</p>
        <p> Easy to manage and update <b>WordPress</b> solutions for non-tech businesses </p>
        <p> </p>
        <h4> Digital Marketing</h4>
        <p> <b>SEO & Google Analytics</b> to maximize your reach and retain visitors to your webpage.</p>

        <hr />
      </div>
    );
  }
}

export default Services;
